    return {
      ast: nullthrows(result.ast),
      functionMap,
    };
  } finally {
    if (OLD_BABEL_ENV) {
      process.env.BABEL_ENV = OLD_BABEL_ENV;
    }
  }
}

function getCacheKey() {
  var key = crypto.createHash("md5");
  cacheKeyParts.forEach((part) => key.update(part));
  return key.digest("hex");
}

module.exports = {
  transform,
  getCacheKey,
};
